import { Form, TextArea,Responsive, Segment } from 'semantic-ui-react'

var bgColors = {
    "Default": "#81b71a",
    "Blue": "#00B1E1",
    "Cyan": "#",
    "Green": "#8CC152",
    "Red": "#E9573F",
    "Yellow": "#F6BB42",
}

class Managermain3 extends React.Component {

    render() {
        return (
            <div>
            <Segment.Group>
                <Responsive as={Segment}>I'm always visible by default</Responsive>
            </Segment.Group>

            <Form>


                <TextArea style={{backgroundColor: bgColors.Yellow}} placeholder='Answers'/>
            </Form>
            </div>
        )
    }
}

export default Managermain3
